////Define Groovy Utils and holder
import com.eviware.soapui.support.XmlHolder;
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def holder = groovyUtils.getXmlHolder(messageExchange.responseContent)

////Assert Http Response is OK
def headers = messageExchange.getResponseHeaders()
log.info headers["#status#"]
assert['HTTP/1.1 200 OK'] == headers["#status#"]

////Get the entire response xml
holder.namespaces["soap"] = "http://schemas.xmlsoap.org/soap/envelope/"
def conversionXml = holder.getDomNode("//soap:Envelope")
log.info "The conversion xml for USD to GBP is " + conversionXml

//// Create a new object of XmlHolder and Pass the xml string from above
def holder2 = new XmlHolder(conversionXml)

holder2.declareNamespace('xn',"http://tempuri.org/")
def getRate = holder2.getNodeValue("//xn:GetConversionRateResult")
///check conversion rate result contains a value
if(getRate!= null){ 
	log.info "Conversion rate from USD - GBP is " + getRate
	}
else{ 
	log.error "Conversion rate result could not be found"
	}

	////Asssert rate is not null
	assert getRate != null

     //// I'm comparing the same value here as rates change by the min
     //// So unless we have an actual value to compare against (like 0.5967 => stated in test doc)
     //// Otherwise this assertion would fail the test
	assert getRate == holder2.getNodeValue("//xn:GetConversionRateResult")

